import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme,
  IconButton 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh', bgcolor: '#121212', color: 'white' }}>
      {/* Full Screen Hero Section */}
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          textAlign: 'center',
          bgcolor: 'black',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'radial-gradient(circle, rgba(255,0,150,0.3), transparent 70%)',
            zIndex: 1,
          }
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2 }}>
          <Typography
            variant="h1"
            sx={{
              fontSize: { xs: '3rem', md: '5rem' },
              fontWeight: 'bold',
              background: 'linear-gradient(to right, #FF416C, #FF4B2B)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            Master Your Time
          </Typography>
          <Typography
            variant="h4"
            sx={{
              mt: 2,
              fontSize: { xs: '1.5rem', md: '2rem' },
              fontWeight: '400',
              color: 'rgba(255,255,255,0.7)',
            }}
          >
            AI-Powered Study Optimization
          </Typography>
          <Box sx={{ mt: 4, display: 'flex', justifyContent: 'center', gap: 2 }}>
            <Button
              variant="contained"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                py: 2,
                px: 4,
                fontSize: '1.2rem',
                borderRadius: '30px',
                background: 'linear-gradient(45deg, #FF416C, #FF4B2B)',
              }}
            >
              Get Started
            </Button>
            <Button
              variant="outlined"
              size="large"
              onClick={() => navigate('/login')}
              sx={{
                py: 2,
                px: 4,
                fontSize: '1.2rem',
                borderRadius: '30px',
                borderColor: '#FF416C',
                color: 'white',
              }}
            >
              Login
            </Button>
          </Box>
        </Container>
        <IconButton
          sx={{
            position: 'absolute',
            bottom: 30,
            left: '50%',
            transform: 'translateX(-50%)',
            color: 'white',
            fontSize: '2rem',
            animation: 'bounce 2s infinite',
            '@keyframes bounce': {
              '0%, 20%, 50%, 80%, 100%': { transform: 'translateY(0)' },
              '40%': { transform: 'translateY(-10px)' },
              '60%': { transform: 'translateY(-5px)' },
            },
          }}
          onClick={scrollToFeatures}
        >
          <KeyboardArrowDownIcon fontSize="large" />
        </IconButton>
      </Box>

      {/* Features Section */}
      <Box id="features" sx={{ py: { xs: 8, md: 12 }, bgcolor: '#1E1E1E' }}>
        <Container maxWidth="lg">
          <Typography variant="h3" align="center" sx={{ mb: { xs: 6, md: 8 }, fontWeight: 600 }}>
            Why Choose Tempo?
          </Typography>
          <Grid container spacing={4}>
            {[
              {
                icon: <AccessTimeIcon sx={{ fontSize: 40, color: '#FF416C' }} />,
                title: "Smart Scheduling",
                description: "AI-powered scheduling adapts to your study habits."
              },
              {
                icon: <AutoGraphIcon sx={{ fontSize: 40, color: '#FF416C' }} />,
                title: "Performance Analytics",
                description: "Track progress and optimize efficiency with insights."
              },
              {
                icon: <CalendarMonthIcon sx={{ fontSize: 40, color: '#FF416C' }} />,
                title: "Seamless Planning",
                description: "Manage your academic schedule effortlessly."
              }
            ].map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Card sx={{ bgcolor: '#292929', color: 'white', textAlign: 'center', p: 4 }}>
                  <Box sx={{ mb: 3 }}>{feature.icon}</Box>
                  <Typography variant="h5" sx={{ fontWeight: 600 }}>{feature.title}</Typography>
                  <Typography variant="body1" sx={{ mt: 1, color: 'rgba(255,255,255,0.7)' }}>
                    {feature.description}
                  </Typography>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
